package com.example.riderapp.model;public class Teamate {	String name;	double longitude;	double latitude;	public String getName() {		return name;	}	public void setName(String name) {		this.name = name;	}	public double getLongitude() {		return longitude;	}	public void setLongitude(double longitude) {		this.longitude = longitude;	}	public double getLatitude() {		return latitude;	}	public void setLatitude(double latitude) {		this.latitude = latitude;	}}